window.onload = function (){
    console.log(program(input.trim()));
}

function program (input){
    let removed = true;

    while(removed){
        for(let i = 0; i < input.length - 1; i++){
            if(shouldRemove(input[i], input[i + 1])){
                input = input.replace(input.substring(i, i + 2), "");
                removed = true;
                break;
            } 
            removed = false;
        }
    }
    console.log(input);
    return input.length;
}

function shouldRemove(a, b){
    return (a !== b && a.toUpperCase() === b.toUpperCase())
}

